import { useNavigate } from "react-router-dom";
import HomeHeaderBar from "../Components/HomeHeaderBar";
import TopBar from "../Components/TopBar";
function Home() {
  const navigate = useNavigate();
  useEffect(() => {
    const token = sessionStorage.getItem("token");
    if (!token) {
      navigate("/");
    }
  }, []);
  return (
    <>
      <div className="top">
        {" "}
        <HomeHeaderBar />
        <TopBar />
      </div>


<div className="body">
    
</div>

    </>
  );
}

export default Home;
